Kan Oksijen Ölçümü Nasıl Yapılır:
1. Saati bilek kemiğinizin bir parmak altında olacak şekilde takın ve bileğinize rahat bir pozisyonda takın; 
2. Kan oksijen algılama moduna girdikten sonra lütfen hareketsiz durun, bileğinizin düz olduğundan ve saatin yukarı baktığından emin olun. Oturuyorsanız kollarınızı saatiniz yukarı bakacak şekilde masaya koyabilirsiniz; 
3. Lütfen nihai sonucu alana kadar kolunuzu sabit tutun.
